// import "../../static/css/style.scss";
class Dashboard extends Component {
  render() {
    return (
      <Layout>
        <Row>
          <Col span={14} md={14} xs={24}>
            Dashboard
          </Col>
        </Row>
      </Layout>
    );
  }
}

export default Dashboard;
